import {gql} from '@apollo/client'

export const GET_DATA = gql`
    query{
        getValue(id: 1) {
            Value
        }
    }    
`
export const GET_ONE_USER = gql`
    query getUser($id: ID){
        getUser(id: $id) {
            id, username
        }
    }    
`
